    "At the end of the hour, the broadcaster who has the most points wins $10 cash! The broadcaster with the 2nd most points wins $5 cash! All points are then reset and a new contest begins. Keep in mind that anonymous users who are viewing your cam do not count towards top ten rankings, so encourage them to register! The maximum amount of points achievable in an hour is six hundred (600).": "\u0412 \u043a\u043e\u043d\u0446\u0435 \u0447\u0430\u0441\u0430 \u0441\u0442\u0440\u0438\u043c\u0435\u0440 \u0441 \u043d\u0430\u0438\u0431\u043e\u043b\u044c\u0448\u0438\u043c \u0447\u0438\u0441\u043b\u043e\u043c \u043e\u0447\u043a\u043e\u0432 \u0432\u044b\u0438\u0433\u0440\u044b\u0432\u0430\u0435\u0442 10\u00a0$. \u0421\u0442\u0440\u0438\u043c\u0435\u0440 \u043d\u0430 \u0432\u0442\u043e\u0440\u043e\u043c \u043c\u0435\u0441\u0442\u0435 \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442 5\u00a0$. \u0417\u0430\u0442\u0435\u043c \u0441\u0447\u0435\u0442\u0447\u0438\u043a \u043e\u0447\u043a\u043e\u0432 \u0441\u0431\u0440\u0430\u0441\u044b\u0432\u0430\u0435\u0442\u0441\u044f, \u0438 \u043a\u043e\u043d\u043a\u0443\u0440\u0441 \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0437\u0430\u043d\u043e\u0432\u043e. \u0410\u043d\u043e\u043d\u0438\u043c\u043d\u044b\u0435 \u0437\u0440\u0438\u0442\u0435\u043b\u0438 \u043d\u0435 \u0437\u0430\u0441\u0447\u0438\u0442\u044b\u0432\u0430\u044e\u0442\u0441\u044f, \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u043c\u043e\u0442\u0438\u0432\u0438\u0440\u0443\u0439\u0442\u0435 \u0438\u0445 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c\u0441\u044f! \u041c\u0430\u043a\u0441\u0438\u043c\u0443\u043c \u043e\u0447\u043a\u043e\u0432 \u0437\u0430 \u0447\u0430\u0441: \u0448\u0435\u0441\u0442\u044c\u0441\u043e\u0442 (600).",
