    "Ignore limit reached. Removed oldest user from list: %(username)s": "\u0421\u043b\u0438\u0448\u043a\u043e\u043c \u043c\u043d\u043e\u0433\u043e \u043b\u044e\u0434\u0435\u0439 \u0432 \u0438\u0433\u043d\u043e\u0440\u0435. \u0418\u0437 \u0441\u043f\u0438\u0441\u043a\u0430 \u0443\u0434\u0430\u043b\u0435\u043d \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c %(username)s.",
