    "User %(username)s was silenced by %(silencer)s and their messages have been removed": "%(silencer)s \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u0435\u0442 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044e %(username)s \u043e\u0431\u0449\u0430\u0442\u044c\u0441\u044f \u0432 \u0447\u0430\u0442\u0435. \u0421\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u044f \u0443\u0434\u0430\u043b\u0435\u043d\u044b.",
